INSERT INTO `adminnotification_inbox` VALUES (1,4,'2016-01-13 20:52:11','Have questions? Magento has big answers at Imagine Commerce.','Big news, bigger experts, and an even bigger ecosystem. Will you be at Imagine Commerce? Join us. ','http://imagine.magento.com',1,0),(2,1,'2016-01-20 20:17:09','Important: Install Magento Community Edition 2.0.1 for Security & Functional Updates – 1/20/2016','Today, we are releasing Magento Community Edition 2.0.1 to improve the security and functionality of Magento 2.0 sites. There are no confirmed attacks related to the security issues, but certain vulnerabilities can potentially be exploited to access customer information or take over administrator sessions. Community Edition 2.0.1 also includes USPS API updates and support for PHP7.0.2, which enables dramatic performance improvements and other benefits. You can download the release from the Community Edition Download Page or by using Composer. Learn more at https://magento.com/security/patches/magento-201-security-update. \n','https://magento.com/security/patches/magento-201-security-update',1,0),(3,1,'2016-01-28 22:08:45','Important: Magento Community Edition 2.0.2 Addresses Upgrade Issues – January 28, 2016','Newly released Magento Community Edition 2.0.2 resolves issues encountered by some users when upgrading Magento Community Edition 2.0.0 and 2.0.1. The issues occur with products that were installed from a compressed archive (.tar.gz, .zip, and .bz2); merchants who used other installation options are not affected. More information is available in the Technical Bulletin at http://devdocs.magento.com/guides/v2.0/release-notes/tech_bull_201-upgrade.html. ','http://devdocs.magento.com/guides/v2.0/release-notes/tech_bull_201-upgrade.html',1,0);
