INSERT INTO `cms_block` VALUES (1,'Footer column content 1','footer_col_1','<ul>\r\n    <li><a href=\"{{store direct_url=\"about-us\"}}\">About Us</a></li>\r\n    <li><a href=\"{{store direct_url=\"customer-service\"}}\">Customer Service</a></li>\r\n    <li><a href=\"{{store url=\"\"}}template-settings\">Template Settings</a></li>\r\n</ul>','2015-12-22 12:21:08','2016-01-25 10:43:48',1),(2,'Footer column content 1','footer_col_1','<ul>\r\n    <li><a href=\"{{store direct_url=\"about-us\"}}\">Wir über uns</a></li>\r\n    <li><a href=\"{{store direct_url=\"customer-service\"}}\">Kundenservice</a></li>\r\n</ul>','2015-12-22 12:21:44','2016-01-25 10:44:00',1),(3,'Footer column content 1','footer_col_1','<ul>\r\n    <li><a href=\"{{store direct_url=\"about-us\"}}\">Acerca de nosotros</a></li>\r\n    <li><a href=\"{{store direct_url=\"customer-service\"}}\">Servicio al Cliente</a></li>\r\n</ul>','2015-12-22 12:22:27','2016-01-25 10:44:10',1),(4,'Footer column content 2','footer_col_2','<div class=\"footer-col\">\r\n    <h4>Why buy from us</h4>\r\n    <div class=\"footer-col-content\">\r\n   	 <ul>\r\n   		 <li><a href=\"#\">Shipping & Returns</a></li>\r\n   		 <li><a href=\"#\">Secure Shopping</a></li>\r\n   		 <li><a href=\"#\">International Shipping</a></li>\r\n   		 <li><a href=\"#\">Affiliates</a></li>\r\n   		 <li><a href=\"#\">Group Sales</a></li>\r\n   	 </ul>\r\n    </div>\r\n</div>','2015-12-22 12:46:26','2016-01-25 07:45:55',1),(5,'Footer column content 2','footer_col_2','<div class=\"footer-col\">\r\n    <h4>Warum bei uns kaufen</h4>\r\n    <div class=\"footer-col-content\">\r\n   	 <ul>\r\n   		 <li><a href=\"#\">Liefer-und Versandkosten</a></li>\r\n   		 <li><a href=\"#\">Sicheres Einkaufen</a></li>\r\n   		 <li><a href=\"#\">Internationaler Versand</a></li>\r\n   		 <li><a href=\"#\">Affiliates</a></li>\r\n   		 <li><a href=\"#\">Group Sales</a></li>\r\n   	 </ul>\r\n    </div>\r\n</div>\r\n','2015-12-22 12:47:00','2016-01-25 07:46:32',1),(6,'Footer column content 2','footer_col_2','<div class=\"footer-col\">\r\n    <h4>?Por que comprar ?</h4>\r\n    <div class=\"footer-col-content\">\r\n   	 <ul>\r\n   		 <li><a href=\"#\">Envios y Devoluciones</a></li>\r\n   		 <li><a href=\"#\">Compras Seguras</a></li>\r\n   		 <li><a href=\"#\">Envio internacional</a></li>\r\n   		 <li><a href=\"#\">Afiliados</a></li>\r\n   		 <li><a href=\"#\">Ventas de Grupo</a></li>\r\n   	 </ul>\r\n    </div>\r\n</div>\r\n','2015-12-22 12:47:28','2016-01-25 07:47:06',1),(7,'Footer column content 3','footer_col_3','<div class=\"footer-col\">\r\n<h4>My account</h4>\r\n    <div class=\"footer-col-content\">\r\n   	 <ul>\r\n   		 <li><a href=\"{{store url=\'customer/account/login/\'}}\">Sign In</a></li>\r\n   		 <li><a href=\"{{store url=\'checkout/cart/\'}}\">View Cart</a></li>\r\n   		 <li><a href=\"{{store url=\'wishlist/\'}}\">My Wishlist</a></li>\r\n   		 <li><a href=\"#\">Track My Order</a></li>\r\n   		 <li><a href=\"#\">Help</a></li>\r\n   	 </ul>\r\n    </div>\r\n</div>','2015-12-22 12:53:44','2016-01-25 07:48:16',1),(8,'Footer column content 3','footer_col_3','<div class=\"footer-col\">\r\n<h4>Mein konto</h4>\r\n    <div class=\"footer-col-content\">\r\n   	 <ul>\r\n   		 <li><a href=\"{{store url=\'customer/account/login/\'}}\">Anmelden</a></li>\r\n   		 <li><a href=\"{{store url=\'checkout/cart/\'}}\">Warenkorb anzeigen</a></li>\r\n   		 <li><a href=\"{{store url=\'wishlist/\'}}\">Mein Wunschzettel</a></li>\r\n   		 <li><a href=\"#\">Meine Bestellung verfolgen</a></li>\r\n   		 <li><a href=\"#\">Hilfe</a></li>\r\n   	 </ul>\r\n    </div>\r\n</div>','2015-12-22 12:54:13','2016-01-25 07:49:20',1),(9,'Footer column content 3','footer_col_3','<div class=\"footer-col\">\r\n<h4>Mi cuenta</h4>\r\n    <div class=\"footer-col-content\">\r\n   	 <ul>\r\n   		 <li><a href=\"{{store url=\'customer/account/login/\'}}\">Inicia sesion</a></li>\r\n   		 <li><a href=\"{{store url=\'checkout/cart/\'}}\">Ver Carrito</a></li>\r\n   		 <li><a href=\"{{store