a>\r\n                </div>\r\n            </div>\r\n        </div>\r\n        <div data-src=\"{{view url=\'images/camera/slides/slide3.jpg\'}}\">\r\n            <div class=\"camera_caption fadeIn\">\r\n                <div class=\"camera_caption_txt\">\r\n					<span class=\"camera_caption_txt--style-7\">Spring - Summer</span>\r\n					<span class=\"camera_caption_txt--style-8\">big Sale</span>\r\n					<span class=\"camera_caption_txt--style-9\">50% off</span>\r\n                    <a href=\"{{store url=\'children.html\'}}\" class=\"camera_caption_txt--btn\">Shop now!</a>\r\n                </div>\r\n            </div>\r\n        </div>\r\n    </div>\r\n</div>','2016-01-28 07:04:17','2016-02-08 10:48:21',1),(12,'Showcases','showcases','<div class=\"showcases\">\r\n	<ul>\r\n		<li><a href=\"{{store url=\'men.html\'}}\">\r\n				<img src=\"{{view url=\'images/media/showcase1.jpg\'}}\" alt=\"showcases-img\">\r\n				<div class=\"showcases--text\"><span>JEANS</span></div>\r\n			</a></li>\r\n		<li><a href=\"{{store url=\'women.html\'}}\">\r\n				<img src=\"{{view url=\'images/media/showcase2.jpg\'}}\" alt=\"showcases-img\">\r\n				<div class=\"showcases--text\"><span>SHIRTS</span></div>\r\n			</a></li>\r\n		<li><a href=\"{{store url=\'children.html\'}}\">\r\n				<img src=\"{{view url=\'images/media/showcase3.jpg\'}}\" alt=\"showcases-img\">\r\n				<div class=\"showcases--text\"><span>ACCESSORIES</span></div>\r\n			</a></li>\r\n		<li><a href=\"{{store url=\'men.html\'}}\">\r\n				<img src=\"{{view url=\'images/media/showcase4.jpg\'}}\" alt=\"showcases-img\">\r\n				<div class=\"showcases--text\"><span>SHOES</span></div>\r\n			</a></li>\r\n	</ul>\r\n</div>','2016-01-29 09:24:49','2016-02-01 10:24:05',1),(13,'Block 1','block-1','<div class=\"block-1\">\r\n	<ul>\r\n		<li>\r\n			<img src=\"{{view url=\'images/media/box-1.jpg\'}}\" alt=\"block-1-img\">\r\n			<div class=\"block-1--text\">\r\n				<span class=\"block-1--text-1\">new arrivals</span>\r\n				<button class=\"block-1--btn\"><a href=\"{{store url=\'graphics-cards.html\'}}\">Shop now!</a></button>\r\n			</div>\r\n		</li>\r\n		<li>\r\n			<img src=\"{{view url=\'images/media/box-2.jpg\'}}\" alt=\"block-1-img\">\r\n			<div class=\"block-1--text\">\r\n				<span class=\"block-1--text-2\">Sale</span>\r\n				<span class=\"block-1--text-3\">-50%</span>\r\n				<button class=\"block-1--btn\"><a href=\"{{store url=\'graphics-cards.html\'}}\">Shop now!</a></button>\r\n			</div>\r\n		</li>\r\n	</ul>\r\n</div>','2016-02-01 10:09:40','2016-02-01 10:24:29',1),(14,'Additional info','add-info','<div class=\"add-info\">\r\n	<ul>\r\n		<li>\r\n			<img src=\"{{view url=\'images/media/add-info-1.jpg\'}}\" alt=\"add-info-img\">\r\n			<div class=\"add-info--content\">\r\n				<span class=\"add-info--title\">Establishing Your Brand</span>\r\n				<span class=\"add-info--text\">Many students are cash-strapped, nowadays. Nevertheless, their purchasing power is very high. Research reveals that 20 million students in the US have a combined disposable income of $417 billion. Moreover, another survey of students\' parents reveals that students now make 70 percent of their purchases themselves.</span>\r\n				<a href=\"{{store url=\'men.html\'}}\" class=\"add-info--link\">read more</a>\r\n			</div>\r\n		</li>\r\n		<li>\r\n			<img src=\"{{view url=\'images/media/add-info-2.jpg\'}}\" alt=\"add-info-img\">\r\n			<div class=\"add-info--content\">\r\n				<span class=\"add-info--title\">Believe in the Business</span>\r\n				<span class=\"add-info--text\">If you have not yet considered this demographic, it is time to reach out to them now! Social media is a popular method for socialization and communication between many young people. Students are the majority users of social networking sites like Facebook and Twitter. These are the right places to introduce brands to young people.</span>\r\n				<a href=\"{{store url=\'women.html\'}}\" class=\"add-info--link\">read more</a>\r\n			</div>\r\n		</li>\r\n		<li>\r\n			<img src=\"{{view url=\'images/media/add-info-3.jpg\'}}\" alt=\"add-info-img\">\r\n			<div class=\"add-info--content\">\r\n				<span class=\"add-info--title\">Impact - The Heart</span>\r\n				<span class=\"add-info--text\"> The problem starts when you stop there instead of setting realizable immediate targets. Success cannot come from one day to the next. So you need to build your dream business bit by bit. When your dreams begin to be transformed into reality thanks to your actions, you become aware of the power you possess for catalyzing success.</span>\r\n				<a href=\"{{store url=\'children.html\'}}\" class=\"add-info--link\">read more</a>\r\n			</div>\r\n		</li>\r\n		<li>\r\n			<img src=\"{{view url=\'images/media/add-info-4.jpg\'}}\" alt=\"add-info-img\">\r\n			<div class=\"add-info--content\">\r\n				<span class=\"add-info--title\">The success of business</span>\r\n				<span class=\"add-info--text\">Many students are cash-strapped, nowadays. Nevertheless, their purchasing power is very high. Research reveals that 20 million students in the US have a combined disposable income of $417 billion. Moreover, another survey of students\' parents reveals that students now make 70 percent of their purchases themselves.</span>\r\n				<a href=\"{{store url=\'men.html\'}}\" class=\"add-info--link\">read more</a>\r\n			</div>\r\n		</li>\r\n	</ul>\r\n</div>','2016-02-02 15:48:55','2016-02-05 07:45:49',1),(15,'Newsletter text','newsletter-text','<div class=\"newsletter-text\">\r\n	<span class=\"newsletter-text--title\">Newsletter</span>\r\n	<span class=\"newsletter-text--txt\">Subscribe to the f2 mailing list to receive updates on new arrivals, special offers and other discount information.</span>\r\n</div>','2016-02-03 07:15:33','2016-02-03 08:35:32',1),(16,'Block-2','block-2','<div class=\"block-2\">\r\n	<ul>\r\n		<li>\r\n			<a href=\"{{store url=\'men.html\'}}\"><img src=\"{{view url=\'images/media/box-3.jpg\'}}\" alt=\"block-1-img\">\r\n				<div class=\"block-2--text\">\r\n					<span class=\"block-2--text-1\">SAVE 20%</span>\r\n					<span class=\"block-2--text-2\">WHEN YOU USE CREDIT CARD</span>\r\n				</div></a>\r\n		</li>\r\n		<li>\r\n			<a href=\"{{store url=\'children.html\'}}\"><img src=\"{{view url=\'images/media/box-4.jpg\'}}\" alt=\"block-1-img\">\r\n				<div class=\"block-2--text\">\r\n					<span class=\"block-2--text-1\">FREE SHIPPING</span>\r\n					<span class=\"block-2--text-2\">ON ORDERS OVER $99</span>\r\n				</div></a>\r\n		</li>\r\n	</ul>\r\n</div>','2016-02-03 10:24:38','2016-02-03 10:58:39',1);
